function getFilenameForCourtPageImage(c) {

    //console.log(c);
    var s = c.citation;
    s = s.replace(/\./g, "_");
    s = s.replace(/ /g, "_");
    s = s.replace(/\?/g, "_");

    return s.trim() + ".png";
}